// Accordion

$(function() {
  $('.accordion').find('.accordion__title').click(function(){
    // Adds active class
    $(this).toggleClass('active');
    // Expand or collapse this panel
    $(this).next().slideToggle('fast');
    // Hide the other panels
    $('.accordion__content').not($(this).next()).slideUp('fast');
    // Removes active class from other titles
    $('.accordion__title').not($(this)).removeClass('active');    
  });
});



// In-view transitions 

$(function(){
  function isScrolledIntoView(elem) {
    var docViewTop = $(window).scrollTop();
    var docViewBottom = docViewTop + $(window).height();

    var elemTop = $(elem).offset().top-65;
    var elemBottom = elemTop + $(elem).height();

    return ((elemBottom <= docViewBottom) && (elemTop >= docViewTop));
  }

  $(window).scroll(function () {
    // All selectors for getting inview      
    $('.class-1, .class-2').each(function () {
      if (isScrolledIntoView(this) === true) {
        $(this).addClass('in-view');
      }
    });
  });
});



// Mobile menu and mobile menu button 

$(function() {
  $('.bmenu__right').click(function() {
    $('.bmenu__right').toggleClass('is-clicked');
  });

  $('.bmenu').click(function(){
    $('.menu-mob').slideToggle('fast');
  });

  $('.logo, .homepage, .offpage__content, .close').click(function(){
    $('.menu-mob').slideUp('fast');
    if($('.bmenu').hasClass('is-clicked')){
       $('.bmenu').removeClass('is-clicked');
    }
  });

  $('.menu-mob__item .open, .menu-mob__item-button a').click(function() {
    $('.menu-mob').slideUp('fast');
    if($('.bmenu').hasClass('is-clicked')){
       $('.bmenu').removeClass('is-clicked');
    }
  });
});


// Submenu (mobile) 

$(function() {
	$('.has-menu--m').click(function() {
		$(this).children('.submenu--m').slideToggle('fast');
		$('.submenu--m').not($(this).children('.submenu--m')).slideUp('fast');
	});
});


